contract SpaceAndTime is IERC20, Ownable {
    using SafeMath for uint256;

    mapping(address => uint256) public _rOwned;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) private _isExcludedFromFee;
    mapping(address => bool) isDividendExempt;
    mapping(address => bool) public _updated;
    mapping(address => bool) public isRoute;
    uint256 private constant MAX = ~uint256(0);
    uint256 private _tTotal;
    uint256 private _rTotal;
    uint256 private _tFeeTotal;
    string private _name;
    string private _symbol;
    uint256 private _decimals;
    uint256 public _taxFee;
    address private _destroyAddress = address(0x000000000000000000000000000000000000dEaD);
 
    uint256 public _fundFee;
    address private fundAddress = address(0x7b03016Ed8af44dd9C25b02184EFA68A696660cC);
    address private fundAddress2 = address(0xE5E49856927E3CaDdFFD29b10759ADb424BE35cc);

    mapping(address => address) public inviter; 
    IUniswapV2Router02 public immutable uniswapV2Router;
    address public uniswapV2Pair;
    uint256 public currentIndex;
    uint256 distributorGas = 500000;
    uint256 public minPeriod = 5 minutes;
    uint256 public LPFeefenhong;
    address private fromAddress;
    address private toAddress;
    address private _tokenOwner;
    address[] public shareholders;
    mapping(address => uint256) public shareholderIndexes;
    uint256 public start_time;   

    constructor() {
        _name = "Space and Time";
        _symbol = "SxT";
        _decimals = 18;
        _fundFee = 0;
        _taxFee = 0;
 
        isRoute[0x10ED43C718714eb63d5aA57B78B54704E256024E]=true;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
        .createPair(address(this), 0x55d398326f99059fF775485246999027B3197955);

        uniswapV2Router = _uniswapV2Router;
        _tTotal = 1000000 * 10 ** _decimals;
        _rTotal = (MAX - (MAX % _tTotal));
        _rOwned[msg.sender] = _rTotal;
        _tokenOwner = msg.sender;
        _isExcludedFromFee[msg.sender] = true;
        _isExcludedFromFee[address(this)] = true;
        isDividendExempt[address(this)] = true;
        isDividendExempt[address(0)] = true;

        _owner = msg.sender;
        emit Transfer(address(0), msg.sender, _tTotal);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() external view override returns (uint256) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return tokenFromReflection(_rOwned[account]);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            msg.sender,
            _allowances[sender][msg.sender].sub(amount, "ERC20: transfer amount exceeds allowance")
        );
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool){
        _approve(
            msg.sender,
            spender,
            _allowances[msg.sender][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool){
        _approve(
            msg.sender,
            spender,
            _allowances[msg.sender][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    function totalFees() public view returns (uint256) {
        return _tFeeTotal;
    }

    function tokenFromReflection(uint256 rAmount) public view returns (uint256) {
        require(
            rAmount <= _rTotal,
            "Amount must be less than total reflections"
        );
        uint256 currentRate = _getRate();
        return rAmount.div(currentRate);
    }

    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }

    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }

    function setStarttime(uint256 num) public onlyOwner {
        start_time = num;
    }

    receive() external payable {}

    function _getRate() private view returns (uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }

    function _getCurrentSupply() private view returns (uint256, uint256) {
        uint256 rSupply = _rTotal;
        uint256 tSupply = _tTotal;
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }

    function isExcludedFromFee(address account) public view returns (bool) {
        return _isExcludedFromFee[account];
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function getReserves() public view returns(uint112 reserve0,uint112 reserve1){
        (reserve0,reserve1,)=IUniswapV2Pair(uniswapV2Pair).getReserves();
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        bool takeFee = false;

        if (from==uniswapV2Pair && isRoute[to]){
            takeFee = false; 
        }else if (from==uniswapV2Pair && !isRoute[to]) {
            if(!_isExcludedFromFee[to]){
                require(start_time<block.timestamp,"not start");
            }
            takeFee = true; 
        }else if (to==uniswapV2Pair) {
             if(!_isExcludedFromFee[from]){
                require(start_time<block.timestamp,"not start");
            }
            takeFee = true;
        }else{
            if (from!=uniswapV2Pair && isRoute[from]){
                 takeFee = false;
            }else {
                 takeFee = false;
            }
        }

        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        }  
         _tokenTransfer(from, to, amount, takeFee);
    }

    function isContract(address account) internal view returns (bool) {
        uint256 size;
        assembly {
            size := extcodesize(account)
        }
        return size > 0;
    }

    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 tAmount,
        bool takeFee
    ) private {

        uint256 currentRate = _getRate();
        uint256 multiple = 1;
        uint256 rAmount = tAmount.mul(currentRate);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        uint256 rate;

        if (takeFee) {
            if (sender==uniswapV2Pair && isRoute[recipient] ){
                _fundFee = 0;
                _taxFee = 0;
            }else if (recipient==uniswapV2Pair) {
                _fundFee = 30;
                _taxFee = 20;
                 _takeTransfer(
                    sender,
                    fundAddress,
                    tAmount.div(1000).mul(_fundFee.mul(multiple)),
                    currentRate
                );
                _takeTransfer(
                    sender,
                    fundAddress2,
                    tAmount.div(1000).mul(_taxFee.mul(multiple)),
                    currentRate
                );
            }else{
                if (sender!=uniswapV2Pair && isRoute[sender]){
                    _fundFee = 0;
                    _taxFee = 0;
                 }else {
                    _fundFee = 0;
                    _taxFee = 0;
                 }
            }
            rate = _taxFee.mul(multiple) + _fundFee.mul(multiple);
        }

        uint256 recipientRate = 1000 - rate;
        _rOwned[recipient] = _rOwned[recipient].add(
            rAmount.div(1000).mul(recipientRate)
        );
        emit Transfer(sender, recipient, tAmount.div(1000).mul(recipientRate));
    }

    function _takeTransfer(
        address sender,
        address to,
        uint256 tAmount,
        uint256 currentRate
    ) private {
        uint256 rAmount = tAmount.mul(currentRate);
        _rOwned[to] = _rOwned[to].add(rAmount);
        emit Transfer(sender, to, tAmount);
    }
}
